import "./language.scss";

type LanguageProps = {
  languge: string;
  knowledge: number;
  motivation: number;
};

function Language(props: LanguageProps) {
  return (
    <div className="language__container">
      <p className="language__container-title">{props.languge}</p>
      <div className="language__container-colorbox">
        <div className="language__container-colorbox-knowledge">knowledge</div>
        <div className="language__container-colorbox-motivation">
          motivation
        </div>
      </div>
    </div>
  );
}

export default Language;
